import './StoryReel.css';
import Story from './Story'

function StoryReel() {
    return (
        <div className='storyReel'>
            <Story 
            image='https://media.istockphoto.com/photos/young-businessman-working-at-office-picture-id1235804195?b=1&k=20&m=1235804195&s=170667a&w=0&h=iKD8CxXTMY9GmZzqsQHWqLggV4Dg2YhD_CqnOTPZI7Y= '
            profileSrc=''
            title=''/>
            
        </div>
    )
}

export default StoryReel;
